description:
Shuriken School follows the extraordinary adventures of a 10-year-old hero Eizan Kaburagi and his friends during their first year at an under-funded ninja school. Lessons take on a new dimension, as kids are shown how to melt into the walls, disappear into a cloud of smoke and fly over rooftops! Teaching methods are unorthodox and absurd things can and do happen. An action comedy about friendship, learning skills and how to surpass oneself.

